/*Table structure for table `cs_trans_found` */

DROP TABLE IF EXISTS `cs_trans_found`;

CREATE TABLE `cs_trans_found` (
  `found_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `invoice_found` varchar(20) DEFAULT NULL COMMENT 'invoice_found',
  `sender_name` varchar(255) NOT NULL,
  `capital_dollar` double DEFAULT '0' COMMENT 'amount dollar before found',
  `capital_bath` double DEFAULT '0' COMMENT 'amount bath before found',
  `capital_reil` double DEFAULT '0' COMMENT 'amount riel before found',
  `refund_dollar` double unsigned DEFAULT '0' COMMENT 'found for dollar',
  `refund_bath` double unsigned DEFAULT '0' COMMENT 'found for bath',
  `refund_riel` double unsigned DEFAULT '0' COMMENT 'found for riel',
  `date_refund` datetime NOT NULL,
  PRIMARY KEY (`found_id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

