/* Procedure structure for procedure `getAllOwer` */

/*!50003 DROP PROCEDURE IF EXISTS  `getAllOwer` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `getAllOwer`()
BEGIN
	  SELECT 
	  mt.`reciever_tel`,
	  a.`name` AS agentname,
	  a.`id` AS agent_id,
	  mt.`subagent_id`,
	  mt.`sender_name`,
	  cur.`name` AS amount_type,
	  cur.`country_id` AS money_type,
	  mt.`id` AS tran_id,
	  sa.`name` AS subname 
	FROM
	  `cs_agents` AS a 
	  INNER JOIN `cs_money_transactions` AS mt 
	    ON (a.`id` = mt.`agent_id`) 
	  INNER JOIN `cs_currencies` AS cur 
	    ON (cur.`id` = mt.`amount_type`) 
	  LEFT JOIN `cs_sub_agents` AS sa 
	    ON (mt.`subagent_id` = sa.`id`) 
	WHERE mt.`status_loan` = 1 
	  AND mt.`reciever_tel` != 0000000000 
	GROUP BY mt.`sender_name`,
	  mt.`reciever_tel` 
	ORDER BY mt.`sender_name`,
	  mt.`reciever_tel`,
	  mt.`amount_type` 
	LIMIT 50;
  END */$$
DELIMITER ;

/* Procedure structure for procedure `getTransactionsCounter` */

/*!50003 DROP PROCEDURE IF EXISTS  `getTransactionsCounter` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `getTransactionsCounter`(IN usrid int)
BEGIN
	SET @total_send := (SELECT COUNT(*) FROM `cs_money_transactions` WHERE `status`=0 AND TO_DAYS(send_date) = TO_DAYS(CURRENT_DATE));
	SET @total_sent := (SELECT  COUNT(*) FROM `cs_money_transactions` WHERE `status`=1 AND TO_DAYS(send_date) = TO_DAYS(CURRENT_DATE));
	SET @total_recieved := (SELECT  COUNT(*) FROM `cs_money_transactions` WHERE `status`=2 AND TO_DAYS(send_date) = TO_DAYS(CURRENT_DATE));
	SET @total_paid := (SELECT  COUNT(*) FROM `cs_money_transactions` WHERE `status`=3 AND TO_DAYS(send_date) = TO_DAYS(CURRENT_DATE));
	SET @user_send := (SELECT COUNT(*) FROM `cs_money_transactions` WHERE `status`=0 AND TO_DAYS(send_date) = TO_DAYS(CURRENT_DATE) AND `user_id`=usrid);
	SET @user_sent := (SELECT  COUNT(*) FROM `cs_money_transactions` WHERE `status`=1 AND TO_DAYS(send_date) = TO_DAYS(CURRENT_DATE)  AND `user_id`=usrid);
	SET @user_recieved := (SELECT  COUNT(*) FROM `cs_money_transactions` WHERE `status`=2 AND TO_DAYS(send_date) = TO_DAYS(CURRENT_DATE)  AND `user_id`=usrid);
	SET @user_paid := (SELECT  COUNT(*) FROM `cs_money_transactions` WHERE `status`=3 AND TO_DAYS(send_date) = TO_DAYS(CURRENT_DATE)  AND `user_id`=usrid);
	SELECT @total_send AS total_send, @total_sent AS total_sent, @total_recieved  AS total_recieved, @total_paid AS total_paid,
	       @user_send AS user_send, @user_sent AS user_sent, @user_recieved  AS user_recieved, @user_paid AS user_paid;
    END */$$
DELIMITER ;

